import matplotlib.pyplot as plt
from scipy.signal import savgol_filter

def draw_class_acc_on_new_figure(class_acc_group, beta):
    """
    绘制三个实验的所有类的准确率变化曲线到一个图中，并对曲线做低通滤波。
    :param class_acc_group: 当前组的类准确率列表（3 个实验）
    :param beta: 当前的 beta 值，作为标题的一部分
    """
    plt.figure(figsize=(8, 6))  # 调整整体图像的大小，宽度变小
    total_epochs = 0  # 累计的总 epoch 数

    for experiment_idx, experiment in enumerate(class_acc_group):
        for experiment_name, class_acc_list in experiment.items():
            # 转置数据，将每个类的准确率变化提取出来
            class_acc_transposed = list(zip(*class_acc_list))  # 转置操作

            # 累积总 epoch
            num_epochs = len(class_acc_list)
            epoch_range = range(total_epochs, total_epochs + num_epochs)

            # 绘制每个类的准确率曲线（平滑处理）
            for class_idx, class_acc in enumerate(class_acc_transposed, start=0):
                # 使用 Savitzky-Golay 滤波器对数据进行平滑处理
                smoothed_acc = savgol_filter(class_acc, window_length=5, polyorder=2, mode='nearest')
                smoothed_acc[smoothed_acc>1.0] = 1.0
                if experiment_idx == 0:
                    plt.plot(epoch_range, smoothed_acc, label=f'Class {class_idx}')
                else:
                    plt.plot(epoch_range, smoothed_acc)
            # 更新累积的总 epoch
            total_epochs += num_epochs
            # 在实验之间绘制分界线，并标注实验名称
            plt.axvline(x=total_epochs, color='gray', linestyle='--', linewidth=1)
            plt.text(total_epochs - num_epochs // 2, 0.5, experiment_name,
                     verticalalignment='center', fontsize=14)  # 调整字体大小

    # 设置字体大小
    plt.xlabel('Epoch', fontsize=16)  # 调整字体大小
    plt.ylabel('Accuracy', fontsize=16)  # 调整字体大小
    plt.yticks([0, 1.0], fontsize=14)  # 设置y轴刻度字体大小
    plt.xticks([0, 150, 300, 450], fontsize=14)  # 设置x轴刻度字体大小
    plt.title(f'Class Accuracy Over Epochs for Beta={beta}', fontsize=18)  # 调整标题字体大小

    # 将图例移至图形的右下角，并减小字体
    plt.legend(fontsize=12, loc='lower right')  # 图例放在右下角并减小字体
    plt.tight_layout()  # 自动调整布局以避免图表内容被遮挡
    plt.show()



# 遍历 semi_marc 中的数据，按每三个实验为一组绘制图
for result in semi_marc:
    beta = result['beta']
    class_acc_group = result['class_acc']
    for i in range(0, len(class_acc_group), 3):  # 每三个实验绘制一张图
        draw_class_acc_on_new_figure(class_acc_group[i:i + 3], beta)